import React from "react";
import {
  Button,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import Chip from "@mui/material/Chip";
import { Box } from "@mui/system";

// ... (other import statements)

const Project = ({ title, description, tags, img, source, liveVersion }) => {
  const openSourceCode = () => {
    window.open(source, "_blank");
  };

  const openLiveVersion = () => {
    window.open(liveVersion, "_blank");
  };

  return (
    <Card sx={{ maxWidth: 375, margin: "1rem" }}>
      {/* ... (other JSX) */}
      <Box
        sx={{
          width: "100%",
          display: "flex",
          justifyContent: "space-around",
          mx: "auto",
          mb: 3,
        }}
      >
        <Button
          size="small"
          style={{ backgroundColor: "rgba(0,199,255,255)" }}
          variant="contained"
          onClick={openSourceCode}
        >
          Source Code
        </Button>
        <Button
          size="small"
          style={{ backgroundColor: "rgba(0,199,255,255)" }}
          variant="contained"
          onClick={openLiveVersion}
        >
          Live Version
        </Button>
      </Box>
      {/* ... (other JSX) */}
    </Card>
  );
};

export default Project;
